import React from 'react';
import logo from '../../assets/images/Logo.png';
import './Header.css';
import SearchBar from '../Main/searchBar/searchBar'; // Update import path
import SearchLogic from '../Main/searchBar/searchLogic'; // Update import path

function Header({ searchResults }) {
  return (
    <header>
      <nav id="navbar">
        <ul>
          <li><img src={logo} alt="Logo" /></li>
          <li><a href="#home">Home</a></li>
          <li><a href="#schedule">Schedule</a></li>
          <li><a href="#program">Programs</a></li>
          <li><a href="#events">Events</a></li>
          <li><a href="#news">News</a></li>
          <li><a href="#weather">Weather</a></li>
          <li><a href="#merch">Merch</a></li>
          <li><a href="#contactus">ContactUs</a></li>
          <li>
            <SearchBar searchResults={searchResults} />
          </li>
        </ul>
      </nav>
      {/* Render SearchLogic component with searchText */}
      <SearchLogic />
    </header>
  );
}

export default Header;
